import React from "react";
import About from "../../pages/about";
import Link from "next/link";

const NavBar = () => {
  return (
    <nav>
      <menu>
        <Link>
          <a href="/">Home</a>
        </Link>
        <Link>
          <a href="/about">About</a>
        </Link>
      </menu>
    </nav>
  );
};

export default NavBar;
